SAVE, SWIPE & SHARE 🩷➡️ ✨ This is probably my number one ask question as a makeup artist. “What’s a good foundation for oily skin?” Anything with a matte finish will help you from getting oily quickly. Two things that would also help would be mattifying primer and any matte powder. Also, like I mentioned before, really press into the skin so your makeup really absorbs it and lock it in making it last longer all day. Comment below if this was helpful for you! 🫶🏼

@charlottetilbury Airbrush Flawless Foundation ✨
@lorealusa Infallible Foundation ✨
@hudabeauty Faux Filter Foundation ✨
@maybelline Fit Me Matte Foundation ✨

